        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 21").content("""
                유민석\n극단적으로 강력한 순간 화력 (E.D 트렌치건 한정)
                트렌치건은 너무나도 협소한 딜각과 없다시피한 근접 선공권을 가졌지만, 그 단점에 대한 보상으로 어마어마한 순간 화력을 뿜어낸다. 적정 사거리에서 3발을 꽂아넣기만 해도 웬만한 근거리 딜러 궁극기 수준의 폭딜이 나오는데, 상황에 따라서는 평타와 우지를 섞으며 이걸 한 번 더 넣을 수도 있다. 이런 엄청난 순간 화력 덕분에 트렌치건 카인은 딜각만 주어진다면 마치 딜러 암살하듯 탱커를 지워버리며, 한정된 시간 안에 트루퍼나 수호자를 제거하는 데에도 탁월한 모습을 보인다. 제 아무리 화력으로 정평이 난 캐릭터라도 트렌치건 6발만큼의 딜을 이런 짧은 시간 안에 쏟아낼 수 없다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 22").content("""
                유민석\n다수 공격 능력 부족
                카인의 스킬들은 1:1에 철저히 특화되어 있어 다수 공격 능력이 없다시피 하다. 평타는 범위가 매우 좁아 사실상 한 명에게만 딜을 넣을 수 있고, 우지는 다수를 공격하려면 탄환을 흩뿌려야 하므로 딜링기로서의 역할을 포기해야 하며, 트렌치건도 범위 공격 판정이 아니라 탄환 하나 하나가 비관통 투사체로 나가기에 다수의 적에게는 그 위력을 발휘할 수 없다. 심지어 저격은 여럿을 동시에 공격하는 것이 원천적으로 불가능하다. 그나마 이론상 정상적인 다수 공격이 가능한 류탄 역시 범위가 평범해 광역기로 보기는 어렵다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 23").content("""
                유민석\n낮은 공성력
                카인의 대부분의 스킬은 대인계수가 1.2인 반면 공성계수는 0.8에 불과하다. 건물을 공격할 때는 대인전 대비 40%의 손해를 본다는 뜻이다. 스킬 구성이 타워링에 적합하지 않은 것도 있지만 이 낮은 공성 대미지 탓에 카인의 공성 효율은 전 캐릭터 중에도 최악이다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 24").content("""
                유민석\n어려운 조준 난이도
                카인은 FPS의 요소가 극대화된 캐릭터로, 좁은 범위의 히트스캔 공격 위주로 스킬이 구성되어 있어 사이퍼즈의 원거리 딜러 중에도 유별나게 정확한 조준을 요구한다. 특히 드라그노프는 FPS 게임에서 저격총을 잡아봤다면 그 조준 난이도를 알 수 있는데, 공격범위가 아예 없어 빗나가면 문자 그대로 탄환 한 발만 날리고 게임에 영향을 전혀 끼칠 수 없다. 트렌치건을 선택하면 이 난점이 조금 해소되긴 하나, 그 트렌치건도 조준이 마냥 편한 스킬이 아닌데다가 팀이 트렌치건 조준을 항상 배려하며 협공할 수도 없는 노릇이라 결국 일정 수준의 조준 실력은 있어야 한다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 25").content("""
                유민석\n최악의 근접전 능력 (드라그노프 한정)
                베테랑 군인이라는 설정이 무색하게도 저격 카인은 근접전이 매우 취약하다. 버트 스트로크는 카인이 근접전에서 능동적으로 내지를 수 있는 사실상 유일한 스킬인데, 바꿔 말해 버트 스트로크가 없는 저격 카인은 근캐의 접근을 허용했다면 긴급회피로 도망가거나 그나마 선딜이 짧은 류탄을 근처에 던지는 것 말고는 대처법이 없다. 후반이 되어 딜러의 콤보 한 바퀴는 버틸 만한 맷집이 갖춰졌다 해도, 이 처참한 근접전 능력 탓에 저격 카인은 근캐에게 습격당할 경우 팀의 지원이 없다면 죽는 건 시간 문제라 봐도 무방하다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 26").content("""
                유민석\n저격 카인은 이기고 있을 때는 승기를 유지하기 쉽지만 반대로 초반부터 팀이 밀린다면 역전하기가 힘들다. 일단 기지 안에 고립된 상황에서는 센트리도 원활히 깔 수 없고 저격도 딜각이 좁아지니 저격 카인 특유의 맵 장악력이 상당 부분 약화된다. 만약 게임 중반부까지 전세를 뒤집지 못했다면 성장 우위를 내준 채로 적 원딜이 서서히 방템을 올리기 시작하는데, 이러한 상황에서 저격 카인은 원딜을 확실히 따지도 못하고, 탱커를 빠르게 녹이지도 못하는 그야말로 무능한 잉여가 돼버린다. 그렇다고 성장력이 좋아서 립을 꾸역꾸역 먹어 후반을 도모하거나 궁 대박으로 일발 역전을 노릴 수 있는 것도 아니다. 결국 저격 카인 플레이어는 초반부터 반드시 승기를 잡아야 한다는 압박감에 눌리며 캐릭터를 운용할 수밖에 없다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 27").content("""
                유민석\n극히 짧은 사거리 (E.D 트렌치건 한정)
                트렌치건 카인은 과장 좀 보태서 팔 긴 근거리 딜러나 다름없을 정도로 원거리 딜러 중 교전 거리가 극히 짧다. 우지와 트렌치건은 원거리 스킬임에도 근캐의 주력기가 닿는 수준으로 붙어야 제 위력이 나오며, 평타와 류탄 또한 사거리가 길다고는 볼 수 없는 스킬이다. 이 때문에 초장거리 히트스캔 공격으로 뭇 원딜들의 최상위 포식자로 군림하는 저격 카인과 대조적이게도, 트렌치건 카인은 사거리 긴 원딜 대부분에게 만만한 사냥감이 돼버린다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 28").content("""
                유민석\n극심한 아군 의존도 (E.D 트렌치건 한정)
                상술했듯 트렌치건 카인은 사거리가 워낙 짧다 보니 필연적으로 적 근거리 캐릭터들과 힘싸움을 벌이게 된다. 하지만 어쨌든 트렌치건 카인은 원거리 캐릭터인지라, 사거리를 희생했음에도 근접전에서 근캐들과 대등하게 맞설 정도의 근접 전투력을 가지고 있는 건 아니다. 결국 사거리 긴 스킬이 없고 근접전도 확실하게 내세울 수 없는 트렌치건 카인은 딜각을 능동적으로 만드는 것이 거의 불가능해, 팀의 철저한 보호를 받으며 움직일 수밖에 없다. 탱커나 서포터가 거의 디코이 이전 브루스 수준으로 돌보며 어떻게든 딜각을 만들어줘야 정상적인 플레이가 가능할 지경이다""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 29").content("""
                유민석\n따로 노는 캐릭터 설계 (E.D 트렌치건 한정)
                기존의 카인은 초창기에 사기로 군림하던 시절 부터 오랜 시간에 걸쳐 어중간한 스킬셋과 스탯으로 드라그노프라는 강력한 영향력을 줄 수 있는 스킬에 의존하는 모양새를 띄던 캐릭터이다. 적의 시야에 포착되지 않는 사거리에서 저격으로 높은 데미지를 줄 수 있는 드라그노프를 지닌 대신 기술 전반적으로 긴 딜타임과 원딜치고는 짧은 사거리, 그리고 부족한 근거리 대처능력을 지니고 있으며 이러한 단점을 메우기 위해 접근을 방해하는 센트리와 위험한 기술을 피할 수 있는 긴급 회피가 존재하는 것이다. 하지만 트렌치건 카인의 경우에는 기존에 드라그노프에 맞춰 디메리트를 크게 물려준 스킬셋을 그대로 가지고서 드라그노프를 포기한 형태를 띄고 있다. 사거리가 짧아서 근거리에서 사격해야 함에도 불구하고 여전히 근거리 대처력은 좋지 않으며 기동력은 원딜 중에서도 최하위권이라 적에게 접근하기도 역으로 도주를 하기도 쉽지 않은데 설상가상으로 이러한 기동성으로 적의 강력한 기술에 대처할 수 있는 게 긴급회피 하나 뿐이다. 그나마 근접전에서 쓰라고 버트 스트로크가 주어진다고는 하지만 엄연히 쿨타임 7초 짜리의 스킬에 짧은 범위와 사거리를 지녀 완전히 근거리에서만 사용할 수 있는데도 선딜이 존재하다 보니 접근전에서는 빠르게 평타로 치고 들어오는 근캐들 상대로는 역부족이다. 이로 인해 원딜러 중에서도 최상급의 순간화력을 지닌 트렌치건이지만 현실적으로 카인의 스킬셋 자체가 그 트렌치건의 발목을 잡는 부분이 매우 많아 드라그노프라는 선택지를 희생하고서 고를 만큼의 메리트가 나오지 못하는 것이다. 때문에 카인과 반대로 하자가 있던 궁극기에 강력한 유틸기들로 무장한 같은 총티어 캐릭인 웨슬리가 샷건을 받았다면 다르지 않았을까 하는 의견 또한 있었는데, 실제로 추후 웨슬리 역시 2차 궁극기를 받으면서 궁극기를 발동하면 이동속도가 증가하고 중원거리에서도 화력을 낼 수 있는 자동 사격이 주어지면서 카인의 사례에서 어느 정도 개선된 모습을 보여주었다는 것이 아이러니.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("유민석").get()).title("공지사항 30").content("""
                유민석\n센트리를 이용한 정찰은 물론이고 저격을 이용한 주변 탐색과 아군 엄호, 한타시 빠질 수 없는 우지의 강력한 화력 지원 등등 그야말로 팀의 레인저라고 할 수 있는 캐릭터다. 장거리에서 주요 목표를 단숨에 제거할 수 있는 저격, 시야를 지속적으로 제공하는 센트리 레이더 등 전반적으로 스킬들의 전략적 가치가 높으며, 그러한 스킬들을 통해 맵을 장악하여 자신을 드러내지 않고서도 적들을 지속적으로 압박할 수 있다. 그래서 마치 시바가 그러하듯이 존재 자체만으로도 적의 행동에 많은 제약을 준다. 카인이 초반에 주도권을 잡으면 게임 구도가 경직되어 재미가 없어진다는 말이 나올 정도다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 31").content("""
                최동철\n하지만 캐릭터의 장점만큼이나 단점 또한 명확할뿐더러, 사이퍼즈에서 손꼽힐 정도로 이질적이면서도 어려운 운영법을 가지고 있다. 그래서 진입장벽이 높은 것은 물론 캐릭터 자체적으로 가진 리스크도 크다는 것을 염두에 두어야 한다. 대부분의 원거리 딜러들은 주력기를 쓴 뒤에도 평타를 통해 어느 정도 지속적인 화력 투사가 가능하며, 일부 캐릭터는 평타를 직접적으로 강화하는 스킬도 보유하고 있다. 하지만 카인의 평타는 저지력이 지나치게 떨어지고 저격은 시전을 위해 안전한 위치를 확보해야 하기에, 두 스킬 모두 적과 대면한 상황에서는 사용하기 곤란한 경우가 많다. 그리고 센트리 레이더라는 차별화된 유틸기의 존재는 분명한 장점이지만, 그 대가로 원거리 딜러라면 일반적으로 가져야 할 딜링용 스킬 하나를 잃었다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 32").content("""
                최동철\n즉, 카인은 한타에서 적에게 내밀 카드가 많지 않다. 안정적으로 사용할 수 있는 주력기는 쿨타임 10초의 우지밖에 없다고 봐야 한다. 그리고 스킬의 공백 사이에 생기는 한타 기여의 부재는 센트리의 시야 확보 능력과 저격의 견제 능력으로 메꿔야 한다. 이 점 때문에 카인의 운영이 이질적이면서도 어려운 것이다. 요컨대 스킬을 사용하기에 적절한 타이밍을 재는 것이 다른 원딜보다 까다롭다. 이 공백을 최소화하기 위해서는 적 원거리 딜러를 저격할 수 있으면서 동시에 자신을 노리는 적들로부터 안전한 위치를 확보할 필요가 있는데, 변화무쌍한 한타 속에서 이를 매번 고려하고 움직이는 것은 유저의 판단력 면에서든, 카인의 기동성 면에서든 정말로 쉽지 않다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 33").content("""
                최동철\n카인의 위치는 다른 원거리 딜러들과 마찬가지로 아군 최후방이다. 적 근캐들과 안전거리를 둘 수 있도록 항상 자리를 신경써야 한다. 저격의 장점을 십분 발휘할 수 있는 시야 밖의 장거리가 이상적이지만, 우지와 류탄도 카인의 엄연한 딜링기이므로 상황에 따라서는 최대 시야보다 약간 짧은 중거리를 유지하는 것도 나쁘지 않다. 막발 - 우지라는 사기급 테크닉 덕분에 막발이 준비되어 있다면 적과 1:1로 마주쳤을 때 높은 확률로 선공을 빼앗을 수 있다. 순간 화력이 강력한 카인 특성상 선타의 확보는 곧 킬로 이어지기 때문에 딜러와의 1:1에서 강한 모습을 보여준다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 34").content("""
                최동철\n그러나 막발을 제외한 나머지 스킬들의 선딜은 긴 편이라 막발을 준비하지 못했다면 드렉슬러 같은 즉발성 스킬을 가지고 있는 원거리 캐릭터와의 싸움에서도 밀릴 수 있으므로 지나친 단독 행동은 금물이다. 그리고 카인은 어그로를 엄청나게 끄는 캐릭터라 카인 유저의 실력이 좋을수록 적 다수로부터 집중적인 마크를 당하는 경우가 잦다. 그러니 아군을 지원하면서 동시에 아군에게 보호받을 필요도 있으므로, 혼자 다니면서 킬만 노리는 것보단 빠른 한타 참여로 후방 지원을 해주는 것이 팀의 승리에 더 도움이 된다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 35").content("""
                최동철\n당연하지만 근접전은 닥치고 무조건 피해야만 한다. 카인은 웨슬리처럼 지뢰가 있는 것도 아니고 막발도 강경직이라 맞고 스킬을 내지를 근캐들이 많은데다가 대부분의 스킬들이 선 딜레이가 있어 근접한 적에게 대응하는 능력이 극히 떨어진다. 거기에 체력까지 최하위권이므로 근접전에서 공격을 허용했다면 그대로 전광판으로 직행하는 경우가 대부분이다. 상술한 막발 - 우지 테크닉으로 이 단점을 어느 정도 보완할 수는 있지만, 근접전에 강한 캐릭터라면 막발과 우지 사이에 충분히 근접 평타를 욱여넣을 수 있어서 완전한 대책은 되지 못한다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 36").content("""
                최동철\n캐릭터 특성상 승기를 잡은 판에서 강한 모습을 보인다. 지고 있는 쪽 입장에서는 불리한 한타 유발을 피하면서 어떻게든 립을 먹어 격차를 좁혀야 하는데 카인이 중앙에서 저격 키고 있으면 그것조차도 난감해지기 때문이다. 무리해서 나갔다가 한두 명 따이기라도 하면 격차는 더욱 벌어진다. 게다가 중앙을 장악하고 있으니 센트리 역시 훨씬 전방에 깔 수 있게 되고, 이에 따라 적들은 한타는커녕 기본적인 성장조차 힘들어지는 판이 지속되어 굉장히 답답해진다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 37").content("""
                최동철\n하지만 반대로 밀리고 있는 판에서 카인은 정말 도움이 안 된다. 우선 본진에 고립된 상황일 테니 센트리를 설치하러 나가기 어렵고, 상대 딜러가 잘 커서 방어 아이템을 구입하기 시작하면 저격의 영향력도 급격히 감소하는데, 설상가상으로 웨슬리마냥 궁 대박으로 한타 역전을 노릴 수 있는 것도 아니다. 따라서 카인을 팀에 기용했다면 반드시 초반 한타 및 라인전에서 우위를 가져올 필요가 있다. 이 시기는 원거리 딜러들이 대부분 방템을 두르지 않았을 때이니 저격의 위력에는 큰 문제가 없을 것이다. 어떻게든 초반 한타에서 승리하여 분위기를 유리하게 이끌었다면 그 다음부터는 운영이 비교적 수월해진다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 38").content("""
                최동철\n또한 높은 대인 공격력을 자랑하긴 하지만 주요 기술인 우지와 저격이 고정된 상태로 한 명에게 화력을 집중해야만 강력한 기술이기 때문에 1명에게 가하는 데미지는 매우 강력하나 안정적인 전선이 없고 화력을 집중하기 힘든 난전에서는 상당히 취약한 모습을 보인다. 한타가 중요한 AOS, 사이퍼즈인 만큼 어찌 보면 상당히 치명적인 약점. 특히나 아군에 마땅한 탱커가 없거나 적진에 돌파력이 뛰어난 캐릭터가 있어 안정적인 전선을 갖추고 싸우기 힘들 경우 마치 스타크래프트의 공성 전차처럼 '고정 터렛' 성격이 강한 카인이 활약하기가 매우 힘들어진다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 39").content("""
                최동철\n따라서 아군과 상대방의 팀 조합의 영향을 가장 크게 받는 캐릭터 중 하나이다. 그래서 일반 공방에서 카인 셀렉러는 상당한 실력이 요구된다. 물론 우리 팀 조합뿐만 아니라 상대 팀 조합에도 큰 영향을 받는다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("최동철").get()).title("공지사항 40").content("""
                최동철\n지형의 영향을 많이 받는 캐릭터이기도 하다. 따라서 아군에 카인이 있을 때 절대 소홀히 해서는 안 되는 것이 바로 카인이 활약하기 좋은 지형에서 이니시에이팅을 하는 것. 카인이 불리한 위치에서 한타를 벌이게 되면 카인은 정말 힘을 못 쓴다. 카인에게 불리한 위치는 길목이 많거나 장애물이 많은 구간. 가장 대표적으로 양 팀 2번 타워 라인 한복판의 양쪽의 2단 언덕을 들 수 있는데 대체로 근캐나 낙궁캐들은 이 언덕을 오르락내리락 하면서 싸운다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 41").content("""
                황중석\n그런데 이 지형이 카인한테는 지옥이다. 특히 공방의 경우 파티보다 팀워크가 상대적으로 부족하기 때문에 근캐들이 먼저 우르르 달려가 한타를 일으키고 이속 느린 카인이 뒤늦게 합류하는 상황이 흔하게 벌어진다. 이럴 경우 카인은 스킬이 난무하는 언덕에 뛰어들어 싸울 수도 없는 노릇이기 때문에 보통 언덕 아래쪽에서 깔짝거리게 된다. 그런데 이 위치가 우지나 류탄 맞추기도 애매하고 무엇보다 저격이 원천 봉쇄되는 위치기 때문에 카인의 한타 기여도가 말 그대로 폭락한다. 상대방도 언덕을 오르락내리락 하기 때문에 저격 맞추기 어렵고 맞춘다고 해도 언덕 아래로 떨어져버리기 때문에 공중에서 한 번 더 총알을 꽂지 않는 이상 후속타를 맞추기는 불가능하다. 더구나 트루퍼 리젠 위치가 바로 2단 언덕 옆쪽이니...""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 42").content("""
                황중석\n이렇듯 불리한 위치에선 정말 힘 못 쓰는 게 카인이다. 그러니까 아군에 카인이 있다면 꼭 위치를 봐가면서 한타하자. 물론 반대로 말하면 적군 입장에서는 최대한 카인이 불리한 곳에서 한타를 일으켜야 한다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 43").content("""
                황중석\n장비 세팅은 보통 공격력+치명타+이속 극공으로 가는 경우가 많다. 방어력은 포기하는 경우가 많은데, 카인은 방어템을 사서 얻는 이득이 완전히 없다고 봐도 된다. 거기에 저격으로 적 딜러를 순식간에 없애버릴 수 있으니 공격 템트리를 갈 수밖에 없다. 카인의 회피기인 긴급회피는 시전 도중 무적 판정을 받기 때문에 적의 한 방 기술을 피할 수 있기 때문이다. 방세팅을 해도 워낙에 물몸이라 효율이 안 나온다는 것이 더 큰 이유이긴 하지만 만약 적이 극공을 탔거나 전세가 어느정도 밀렸을 경우 자신을 암살할 수 있는 여건을 가진 근딜이 있거나, 원딜의 짧은 대치상황에도 스킬, 혹은 연계를 버티지 못하고 죽는다고 한다면 1티 → 1바지로 차근차근 구입하는 것이 좋다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 44").content("""
                황중석\n그리고 저격 링은 구입할 수 있는 레벨에 맞춰 최적의 루트로 템 트리를 타서 빠르게 구하는 것이 좋다. 어찌되었건 카인의 주딜은 저격이기 때문.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 45").content("""
                황중석\n또한 우지 링과 류탄 링은 자신의 세팅과 상황에 따라 차근차근 사는 것이 좋다. 류탄 링은 주로 라인을 밀거나 센티넬, 철거반 등을 제거하여 립을 회수하는데에 유용하여 구입되고, 우지는 현재 구입 시 순간적이게 데미지를 올릴 수 있는 버프를 가진 '연사의 파이프', 혹은 4링이 사용되는데, 이는 한타가 시작할 때 여유가 되는대로 구입하는 것이 좋다. 우지의 데미지가 훌륭하다는 점은 있지만 주딜은 엄연히 저격이며, 우지의 긴 사용시간 특성상 위험성을 부담하고 있기 때문에 아군의 백업을 받기 전 까지 적을 묶으며 생존하거나, 아군의 후방에서 적을 묶어두며 백업을 하는 용도가 더 크다는 것을 숙지하기를 바란다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 46").content("""
                황중석\n우지→류탄→저격: 가장 기본적인 콤보. 이 콤보는 즉결심판 후에도 가능하므로 만약 잡기에 성공한다면 그야말로 일발역전의 기회를 마련할 수 있다. 류탄 에 맞은적이 땅에 닿기전에 공중저격을 명중 시키는 테크닉은 그야말로 필수 테크닉이다. 연습장에서는 힘들다. 다리 유니크가 있다면 막발→우지가 부드럽게 이어진다. 류탄 후 저격을 맞히는 것을 보다 안정적으로 하고 싶다면 류탄을 적에게 직격시키는 것이 아니라 옆으로 던져서 시간차로 폭발을 일으키는 것이 좋다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 47").content("""
                황중석\n우지→저격: 류탄을 쓸 수 없는 상황일 경우. 일반적으로 이 콤보를 쓰는 경우는 적이 멀어 류탄을 명중시키기 힘든 경우이다. 이 콤보를 성공시키려면 우지는 적당히 쏜 뒤 취소하고 바로 저격을 하는 게 좋다. 우지를 너무 오랫동안 쏠 경우 끝에 잠깐동안 멍때리게 되기 때문에 저격이 연계되지 않는 경우가 종종 발생하기 때문. 화면 오른쪽의 흰색 게이지를 잘 보고 연계해야 한다.""").status(NoticeStatus.PUBLISHED).build());
        noticeRepository.save(Notice.builder().member(memberRepository.findByName("황중석").get()).title("공지사항 48").content("""
                황중석\n류탄→우지→류탄→저격: 가장 강력한 콤보. 이 콤보의 포인트는 첫번째 류탄 후 우지를 최대한 늦게 쏘는 것. 그래야만 다음 류탄을 던질 쿨타임을 벌 수 있다. 평타를 활용해 적이 공중에 떠있는 시간을 조금이라도 늘려주면 콤보 잇기에 좋다. 그리고 두번째 류탄의 경우엔 적을 직접 맞추지 말고 적의 살짝 앞쪽에 터뜨리는 것이 저격 연계가 좀 더 수월하다. 타이밍이 상당히 빠듯하므로 연습이 조금 필요한 콤보. 모자 유니크나 우지 임팩트가 있으면 우지로 적을 더 오래 공중에 붙잡아둘 수 있기 때문에 콤보 넣기가 쉬워진다. 거리가 가깝다면 첫 류탄 후 즉결심판→우지→류탄→저격으로도 연계가 가능하다. 또는 레어 아이템인 '류탄 디바이스' 를 착용하면 30초 동안 쿨타임이 34% 감소하는 효과가 있어서 저 빡빡한 콤보가 부드럽게 이어진다.""").status(NoticeStatus.PUBLISHED).build());
